import React from 'react';
import Nav from "./Nav";

const Header = (props) =>{
    return(
        <>
            <header>
                    <div class="holder">
                    <img src="img/logo.svg" width="100" alt="InsumosIT"/>
                    <h1>Insumos IT</h1>
                </div>
            </header>
            <Nav/>
        </>
    );
}

export default Header;
